import React from 'react';
import styles from './Items.module.css'

const Items = ({devices}) => {
    return (
        <div>
            {devices.map(item => (
                <div className={styles.item}>
                    <img src={item.img} />
                    <p>{item.name}</p>
                    <p>Rating: {item.rating}</p>
                    <p>Price: {item.price}$</p>
                </div>
            ))}
        </div>
    );
};

export default Items;
